import styles from './Slider.modules.css'
import photoFirst from '../photos/photoFirst.png'


const Slider = () => {
  return (
    <div className={styles}>
      <div className="darkSides">
        <img src={photoFirst} alt="image of enviroment" />
        <img src={photoFirst} alt="image of enviroment" />
      </div>
    </div>
  )
}

export default Slider
